t(mail.getImg(),true);//setText \n   \n           // addAttachment \n           helper.addAttachment(f1.getName(),f1);\n           helper.addAttachment(f2.getName(),f2);\n   \n           javaMailSender.send(message);\n   \n       } catch (Exception e) {\n           e.printStackTrace();\n       }\n   \n   }\n   \n\n\n# \n\n\n# \n\n * \n\n * \n\n * \n\n * \n\n * \n   \n   \n\n * \n   \n   * JMS()\n     \n     \n   \n   * AMQP()\n     \n     \n   \n   * MQTT()\n     \n     > \n\n * \n   \n   * ActiveMQ\n   * RabbitMQ\n   * RocketMQ\n   * Kafka\n\n\n# \n\n * ArrayList\n\n//\n@Service\npublic class MessageServiceImpl implements IMessageService {\n\n    private ArrayList<String> msgList=new ArrayList<String>();\n\n    @Override //\n    public void sendMessage(String id) {\n\n        System.out.println("id"+id);\n        msgList.add(id);\n\n    }\n\n    @Override//\n    public String doMessage() {\n        String id = msgList.remove(0);//id\n        System.out.println("id"+id);\n        return id;\n    }\n}\n\n\n\n# ActiveMQ\n\n * \n   \n   * D:\\Program Files\\mq\\activemq\\apache-activemq-5.16.3\\bin\\win64\\activemq.bat \n   *  http://127.0.0.1:8161/\n\n * \n   \n   \x3c!-- ActiveMQ--\x3e\n   <dependency>\n       <groupId>org.springframework.boot</groupId>\n       <artifactId>spring-boot-starter-activemq</artifactId>\n   </dependency>\n   \n\n * yml\n   \n   #ActiveMQ\n   spring:\n     activemq:\n       broker-url: tcp://localhost:61616\n     jms:\n       template:\n         default-destination: diana #destination\n       pub-sub-domain: true #false\n   \n\n * \n   \n   * JDBC\n   * \n   \n   @Autowired\n   private JmsMessagingTemplate messagingTemplate; //  \n   \n   @Override //\n   public void sendMessage(String id) {\n   \n       System.out.println("id"+id);\n       //messagingTemplate.convertAndSend(id);  //   default-destination: diana\n       messagingTemplate.convertAndSend("order.queue.id",id);// destination\n   }\n   \n   @Override// ----------\n   public String doMessage() {\n       //        String id = messagingTemplate.receiveAndConvert(String.class);//destinationdiana \n       String id = messagingTemplate.receiveAndConvert("order.queue.id",String.class);\n       System.out.println("id"+id);\n       return id;\n   }\n   \n   \n   //\n   @Component\n   public class MessageListener {\n   \n      @JmsListener(destination = "order.queue.id")//----------\n      @SendTo("order.other.queue.id")//\n       public String receive(String id) {\n           System.out.println("id"+id);\n           return "new:"+id;\n       }\n   \n   \n   }\n   \n\n\n# RabbitMQ\n\n * \n   \n   D:\\Program Files\\mq\\rabbitmq\\rabbitmq\\rabbitmq\\rabbitmq_server-3.9.13\\sbincmd\n   \n   * rabbitmq-service.bat strat\n   * rabbitmq-service.bat stop\n   * rabbitmq-service.bat staus\n   * rabbitmq-plugins.bat list\n   * rabbitmq-plugins.bat enable rabbitmq_management\n\n * rabbitmq_management 15672\n   \n   *  guestguest\n   \n   * \n   \n   \n\n * \n   \n   \x3c!-- rabbitmq--\x3e\n   <dependency>\n       <groupId>org.springframework.boot</groupId>\n       <artifactId>spring-boot-starter-amqp</artifactId>\n   </dependency>\n   \n\n * yml\n   \n   # rabbitmq\n   rabbitmq:\n     host: localhost\n     port: 5672  #5672 15672\n   \n\n * \n   \n   * Direct\n     \n     // rabbitmq  \n     @Configuration\n     public class RabbitmqConfigDirect {\n     \n         @Bean//\n         public Queue directQueue(){\n             return new Queue("direct_queue");\n         }\n         @Bean//\n         public Queue directQueue2(){\n             //durable: false\n             //exclusive falsetrue,\n             //autoDelete: \n             return new Queue("direct_queue2",true,false,false);\n         }\n     \n         @Bean//\n         public DirectExchange directExchange(){\n             return new DirectExchange("directExchange");\n         }\n     \n         @Bean//\n         public Binding bindingDirect(){\n             return BindingBuilder.bind(directQueue()).to(directExchange()).with("direct");\n         }\n         @Bean//\n         public Binding bindingDirect2(){\n             return BindingBuilder.bind(directQueue2()).to(directExchange()).with("direct2");\n         }\n     \n     }\n     \n   \n   * Topic\n     \n     * Direct  \n     \n     ![rabbit ](/assets//springboot/rabbit .png)\n     \n     * \n     \n     @Bean//\n     public Binding bindingTopic(){\n         //* \n         return BindingBuilder.bind(topicQueue()).to(topicExchange()).with("topic.*.id");\n     }\n     @Bean//\n     public Binding bindingTopic2(){\n         //\n         return BindingBuilder.bind(topicQueue2()).to(topicExchange()).with("topic.orders.*");\n     }\n     \n   \n   * \n     \n     @Autowired\n     private AmqpTemplate amqpTemplate;\n     \n     @Override\n     public void sendMessage(String id) {\n         System.out.println("id"+id);\n         //directExchangedirect--\n         amqpTemplate.convertAndSend("directExchange","direct",id);\n     }\n     \n     @Overridetopic\n     public void sendMessage(String id) {\n         System.out.println("id"+id);\n         //topicExchangetopic.orders.id --\n         amqpTemplate.convertAndSend("topicExchange","topic.orders.id",id);\n     }\n     \n   \n   * \n     \n     * @RabbitListener(queues = "direct_queue")\n     \n     @RabbitListener(queues = "direct_queue")//----------\n     public void receive(String id) {\n         System.out.println("a1id"+id);\n     }\n     \n     @RabbitListener(queues = "topic_queue")//----topic------\n     public void receive(String id) {\n         System.out.println("queue1id"+id);\n     }\n     \n     \n     * \n\n\n# RocketMQ\n\n * \n   \n   * java\n     \n     runserver.cmdrunbroker.cmd\n     \n     * 1.JAVA_HOME set JAVAHOME="%JAVA_HOME%"\n     * 2.%JAVAHOME%%JAVA_HOME%set "JAVA_OPT=%JAVA_OPT% -Djava.ext.dirs=%BASE_DIR%lib;%JAVAHOME%\\jre\\lib\\ext"\n     * 3.%CLASSPATH%"%CLASSPATH%",\n   \n   * \n     \n     * mqnamesrv.cmd,\n     * mqbroker.cmd\n     * tools org.apache.rocketmq.exemple.quickstart.Producer\n     * tools org.apache.rocketmq.exemple.quickstart.Consumer\n\n * \n   \n   \x3c!-- rocketmq--\x3e\n   <dependency>\n       <groupId>org.apache.rocketmq</groupId>\n       <artifactId>rocketmq-spring-boot-starter</artifactId>\n       <version>2.2.2</version>\n   </dependency>\n   \n\n * yml\n   \n   #rocketmq\n   rocketmq:\n     name-server: localhost:9876\n     producer:\n       group: group_rocketmq #\n   \n\n * \n   \n   * service\n   \n   @Autowired\n   private RocketMQTemplate rocketMQTemplate;\n   \n   @Override\n   public void sendMessage(String id) {\n       System.out.println("id"+id);\n       //        rocketMQTemplate.convertAndSend("order_id",id);//\n   \n       //\n       SendCallback callback=new SendCallback() {\n           @Override\n           public void onSuccess(SendResult sendResult) {\n               System.out.println("");\n           }\n   \n           @Override\n           public void onException(Throwable throwable) {\n               System.out.println("");\n   \n           }\n       };//\n       rocketMQTemplate.asyncSend("order_id",id,callback);\n   }\n   \n   \n   * listener \n   \n   @Component//\n   //destination    ()\n   @RocketMQMessageListener(topic = "order_id",consumerGroup = "group_rocketmq")\n   public class MessageListener implements RocketMQListener<String> {\n   \n       @Override\n       public void onMessage(String id) {\n           System.out.println("id"+id);\n       }\n   \n   }\n   \n\n\n# Kafka\n\n * \n   \n   * zookeeper zookeeper-server-start.bat ../../config/zookeeper.properties\n     *  2181\n   * kafka kafka-server-start ..\\..\\config\\server.properties\n     * 9092\n   * topic kafka-topics --create --zookeeper localhost:2181 --replication-factor 1 --partitions 1 --topic diana\n   * topic kafka-topics --zookeeper localhost:2181 --list\n   * topic kafka-topics --delete --zookeeper localhost:2181 --topic diana\n   *  kafka-console-producer --broker-list localhost:9092 --topic diana\n   *  kafka-console-consumer --bootstrap-server localhost:9092 --topic diana --from-beginning\n\n * \n   \n   \x3c!-- kafka--\x3e\n   <dependency>\n       <groupId>org.springframework.kafka</groupId>\n       <artifactId>spring-kafka</artifactId>\n   </dependency>\n   \n\n * yml\n   \n   #kafka\n   kafka:\n     bootstrap-servers: localhost:9092\n     consumer:\n       group-id: order #id\n   \n\n * \n   \n   * service\n   \n   @Autowired\n   private KafkaTemplate<String,String> kafkaTemplate;\n   \n   @Override\n   public void sendMessage(String id) {\n       System.out.println("(kafka)id"+id);\n       kafkaTemplate.send("diana",id);//topic \n   }\n   \n   \n   * listener\n   \n   @KafkaListener(topics = "diana")//topic\n   public void onMessage(ConsumerRecord<String,String> record) {\n       System.out.println("(kafaka)id"+record.value());\n   }\n   ',normalizedContent:'# \n\n\n\n * \n   \n   @autowired\n   private bookmapper bookmapper;\n   //hashmapidbook\n   private hashmap<integer,book> cache=new hashmap<>();\n   \n   \n   @override //hashmap  \n   public book getbyid(int id) {\n       book book = cache.get(id);\n       //\n       if(book == null){\n           book querybook = bookmapper.selectbyid(id);\n           cache.put(id,querybook);\n           return querybook;\n       }\n       return cache.get(id);\n   }\n   \n\n * ()\n   \n   @service\n   public class msgserviceimpl implements imsgservice {\n   \n       private hashmap<string,string> cache=new hashmap<>();\n   \n       @override //\n       public string get(string tel) {\n           string code = tel.substring(tel.length() - 6);// 6-- \n           cache.put(tel,code);//\n           return code;\n       }\n   \n       @override //\n       public boolean check(string tel, string code) {//\n           string querycode = cache.get(tel);\n           return querycode.equals(code);\n       }\n   }\n   \n\n\n# simple\n\nspringbootsimple\n\n * \n   \n   \x3c!-- --\x3e\n   <dependency>\n       <groupid>org.springframework.boot</groupid>\n       <artifactid>spring-boot-starter-cache</artifactid>\n   </dependency>\n   \n\n *  @enablecaching\n   \n   @springbootapplication\n   @enablecaching //\n   public class cacheapplication {\n   }\n   \n\n *  @cacheable\n   \n   //springboot\n   //return \n   //return \n   @cacheable(value = "cachespace",key = "#id") //value  //id\n   public book getbyid(int id) {\n       return bookmapper.selectbyid(id);\n   }\n   \n\n * ( )\n   \n   * \n     \n     * \n       \n       private final string[] patch={"000000","00000","0000","000","00","0",""};\n       \n       // 6\n       public string generator(string tel){\n           int hash =tel.hashcode();\n           int encryption=20206666;\n           long result=hash^encryption;//\n           long nowtime=system.currenttimemillis();\n           result = nowtime ^ result;\n           long code = result % 1000000;//6\n           code=code < 0 ? -code:code;//\n           string codestr=code+"";//\n           int length = codestr.length();//0,150,240 \n           return patch[length]+codestr;//6\n       }\n       \n     \n     * \n       \n       servicespring\n       \n       @cacheablenull\n       \n       //get service\n       //spring\n       \n       @cacheable(value = "smscode",key="#tel") //null\n       public string getcode(string tel){\n           return null;\n       }\n       \n   \n   * service\n     \n     @cacheput\n     \n     @cacheable\n     \n     .equals()null\n     \n     @autowired\n      private codeutils codeutils;\n     \n      @override\n     // @cacheable(value = "smscode",key="#tel") //key\n      @cacheput(value = "smscode",key="#tel") //, \n      public string sendcode(string tel) {\n          string code = codeutils.generator(tel);//\n          return code;\n      }\n     \n     \n      @override\n      public boolean checkcode(smscode smscode) {\n          //\n          string querycode = codeutils.getcode(smscode.gettel());\n          return smscode.getcode().equals(querycode);//null\n      }\n     \n\n\n# ehcache\n\nspringbootehcache\n\n * \n   \n   \x3c!--  ehcache--\x3e\n   <dependency>\n       <groupid>net.sf.ehcache</groupid>\n       <artifactid>ehcache</artifactid>\n   </dependency>\n   \n\n * ymlspringboot \n   \n   #cache   simple\n   cache:\n     type: ehcache\n   \n\n * \n   \n   ehcache.xml\n\n\n# redis\n\nspringbootredis\n\n * \n   \n   \x3c!--  redis--\x3e\n   <dependency>\n       <groupid>org.springframework.boot</groupid>\n       <artifactid>spring-boot-starter-data-redis</artifactid>\n   </dependency>\n   \n\n * yml\n   \n     #redis\n     cache:\n       type: redis\n       redis:\n   #      cache-null-values: false   #\n   #      enable-statistics: false\n         time-to-live: 20s    # \n   #      use-key-prefix: false  #   "smscode::17854201283"  "17854201283" truetrue\n   #      key-prefix: sms_  #\n   \n     redis:\n       host: localhost\n       port: 6379\n   \n\n\n# memcached\n\nspringbootmemcached\n\n *  \n   \n   \n\n * \n   \n   \x3c!-- memcached--\x3e\n   <dependency>\n       <groupid>com.googlecode.xmemcached</groupid>\n       <artifactid>xmemcached</artifactid>\n       <version>2.4.7</version>\n   </dependency>\n   \n\n * yml\n   \n   *  memcachedspringboot\n   \n   #memcache\n   memcached:\n     servers: localhost:11211\n     poolsize: 10\n     optimeout: 3000   #3\n   \n\n * \n   \n   * \n     \n     //memcached\n     @component\n     @data\n     @configurationproperties(prefix = "memcached")\n     public class xmemcacheproperties {\n         private string servers;\n         private int poolsize;\n         private long optimeout;\n     }\n     \n   \n   * \n     \n     @bean\n     public memcachedclient getmemcacaheclient() throws ioexception {\n         //builder  \n         memcachedclientbuilder memcachedclientbuilder= new xmemcachedclientbuilder(xmemcacheproperties.getservers());\n         //\n         memcachedclientbuilder.setconnectionpoolsize(xmemcacheproperties.getpoolsize());//\n         memcachedclientbuilder.setoptimeout(xmemcacheproperties.getoptimeout());//\n         //\n         memcachedclient memcachedclient=memcachedclientbuilder.build();\n         return memcachedclient;\n     }\n     \n   \n   * service\n     \n     * @cacheable,setput\n     * @autowired@resource(name="")\n     \n     @autowired\n     private codeutils codeutils;\n     \n     @override\n     public string sendcode(string tel) {\n         system.out.println(111);\n         string code = codeutils.generator(tel);//\n         try {\n             memcachedclient.set(tel,10,code);//key0,1010s,\n         } catch (exception e) {\n             e.printstacktrace();\n         }\n         return code;\n     }\n     \n     \n     @override\n     public boolean checkcode(smscode smscode) {\n         //\n         string querycode= null;\n         try {\n             //\n             querycode = memcachedclient.get(smscode.gettel()).tostring();\n         } catch (exception e) {\n             e.printstacktrace();\n         }\n         return smscode.getcode().equals(querycode);//null\n     }\n     \n\n\n# jetcache\n\n\n\n * \n   \n   <dependency>\n       <groupid>com.alicp.jetcache</groupid>\n       <artifactid>jetcache-starter-redis</artifactid>\n       <version>2.6.4</version>\n   </dependency>\n   \n\n * yml\n   \n   #jetcache\n   jetcache:\n     statintervalminutes: 1  #1 \n     areaincachename: false  #  #"book_2"      ---"default_book_2"\n     #\n     local:\n       default:\n         type: linkedhashmap\n         keyconvertor: fastjson   #key\n   \n     #\n     remote:\n       default:\n         type: redis\n         host: localhost\n         port: 6379\n         keyconvertor: fastjson   #key\n         valueencode: java        #javaredis\n         valuedecode: java        #redisjava\n         poolconfig:  #\n           maxtotal: 50\n       sms:\n         type: redis\n         host: localhost\n         port: 6379\n         keyconvertor: fastjson   #key\n         valueencode: java        #javaredis\n         valuedecode: java        #redisjava\n         poolconfig: #\n           maxtotal: 50\n   \n   \n   \n\n * \n   \n   * \n   \n   @springbootapplication\n   //jetcache\n   @enablecreatecacheannotation\n   // \n   @enablemethodcache(basepackages = "com.diana")\n   public class jetcacheapplication {\n   }\n   \n   \n   * putget\n   \n    //remote\n   //0,\n   @createcache(area = "sms",name="jetcache_",expire = 10)\n   private cache<string,string> jetcache_;\n   \n   \n   //    //remote  \n   //    @createcache(area = "sms",name="jetcache2_",expire = 10)\n   //    private cache<string,string> jetcache2_;\n   \n   \n   //local\n   //-- reids  bothredis\n   @createcache(name="jetcache_local_",expire = 100,cachetype = cachetype.local)\n   private cache<string,string> jetcache_local_;\n   \n   \n   @override\n   public string sendcode(string tel) {\n       string code = codeutils.generator(tel);//\n       //        jetcache_.put(tel,code);//\n       jetcache_local_.put(tel,code);//\n       return code;\n   }\n   \n   \n   @override\n   public boolean checkcode(smscode smscode) {\n       //\n       //        string querycode = jetcache_.get(smscode.gettel());//\n       string querycode = jetcache_local_.get(smscode.gettel());//\n       return smscode.getcode().equals(querycode);//null\n   }\n   \n   \n   * \n     \n     public class book implements serializable {}  //\n     \n   \n   * \n     \n     * @cached \n     * @cacherefresh,\n     * @cacheinvalidate,delete\n     * @cacheupdateupdate\n   \n   @override\n   //jetcache redis\n   @cached(name="book_",key = "#id",expire = 3600)\n   //@cacherefresh(refresh = 10)//10s \n   public book getbyid(int id) {\n       return bookmapper.selectbyid(id);\n   }\n   \n   \n   @override\n   public boolean save(book book) {\n       return bookmapper.insert(book)>0;\n   }\n   \n   @override\n   @cacheinvalidate(name="book_",key = "#id")//\n   public boolean delete(int id ) {\n       return bookmapper.deletebyid(id)>0;\n   }\n   \n   @override\n   @cacheupdate(name="book_",key="#book.id",value = "#book")  //\n   public boolean update(book book) {\n       return bookmapper.updatebyid(book)>0;\n   }  \n   \n\n\n# j2cache\n\nj2cache\n\n reidsehcache2\n\n * \n   \n   \x3c!-- j2cache--\x3e\n   <dependency>\n       <groupid>net.oschina.j2cache</groupid>\n       <artifactid>j2cache-core</artifactid>\n       <version>2.8.5-release</version>\n   </dependency>\n   <dependency>\x3c!-- redis,--\x3e\n       <groupid>net.oschina.j2cache</groupid>\n       <artifactid>j2cache-spring-boot2-starter</artifactid>\n       <version>2.8.0-release</version>\n   </dependency>\n   \n\n * yml\n   \n   j2cache:\n     config-location: j2cache.properties  #\n   \n\n * properties\n   \n   #1\n   j2cache.l1.provider_class=ehcache\n   ehcache.configxml=ehcache.xml\n   \n   \n   #  true\n   j2cache.l2-cache-open=true \n   \n   \n   #2\n   # \n   j2cache.l2.provider_class=net.oschina.j2cache.cache.support.redis.springredisprovider\n   j2cache.l2.config_section=redis\n   redis.hosts=localhost:6379\n   #\n   redis.mode=single\n   # bkgj2cache.properties\n   redis.namespace=smscode\n   #1) "smscode:sms:17854201285" \n   #2) "sms:17854201285"  \n   \n   \n   #1  \n   #  redis \n   j2cache.broadcast= net.oschina.j2cache.cache.support.redis.springredispubsubpolicy\n   \n\n * \n   \n   @autowired//\n   private cachechannel cachechannel;\n   \n   @override\n   public string sendcode(string tel) {\n       string code = codeutils.generator(tel);//\n       cachechannel.set("sms",tel,code);\n       return code;\n   }\n   \n   \n   @override\n   public boolean checkcode(smscode smscode) {\n       string querycode = cachechannel.get("sms",smscode.gettel()).asstring();\n       return smscode.getcode().equals(querycode);//null\n   }\n   \n\n\n# \n\n\n\n * java \n   \n   public class timertaskapp {\n   \n       public static void main(string[] args){\n           timer timer=new timer(); //\n           timertask task=new timertask() {\n               @override\n               public void run() {\n                   system.out.println("timer is running ");\n               }\n           };//\n   \n           timer.schedule(task,0,2000); //2s\n       }\n   \n   \n   }\n   \n\n\n# springbootquartz\n\n\n\n * \n   \n   * (job)\n   * (jobdetail): \n   * triggercron\n   * scheduler\n\n * \n   \n   \x3c!-- quartz--\x3e\n   <dependency>\n       <groupid>org.springframework.boot</groupid>\n       <artifactid>spring-boot-starter-quartz</artifactid>\n   </dependency>\n   \n\n * quartzjobbean\n   \n   //\n   public class myquartz extends quartzjobbean {\n       @override//context \n       protected void executeinternal(jobexecutioncontext context) throws jobexecutionexception {\n           system.out.println("task is running");\n       }\n   }\n   \n\n * \n   \n   //quartz \n   @configuration\n   public class quartzconfig {\n       @bean\n       public jobdetail printjobdetail(){\n           //\n           return jobbuilder.newjob(myquartz.class).storedurably().build();\n       }\n   \n       @bean\n       public trigger printjobtrigger(){\n           //\n           //("0/3 10 6 11 4 ?"); 41161003\n           //\n           schedulebuilder schedulebuilder=cronschedulebuilder.cronschedule("0/3 * * * * ?");//0s3\n           return triggerbuilder.newtrigger().forjob(printjobdetail()).withschedule(schedulebuilder).build();\n       }\n   \n   }\n   \n\n\n# springboot \n\n\n\n * \n   \n   @enablescheduling\n   public class taskapplication {\n   }\n   \n\n * yml\n   \n   spring:\n     task:\n       scheduling:\n         #  1\n         pool:\n           size: 1\n         #\n         thread-name-prefix: spring_task_\n         shutdown:\n           #\n           await-termination: false\n           #\n           await-termination-period: 10s\n   \n\n * cron\n   \n   @scheduled(cron = "0/6 * * * * ?")\n   public void print(){\n       system.out.println("spring task run...");\n       //\n        system.out.println(thread.currentthread().getname()+":spring task run...");\n   }\n   \n\n\n# \n\n\n# spirngbootjavamail\n\n * \n   \n   * smtp\n   * pop3\n   * imappop3(pop3)\n\n * \n   \n   \x3c!-- mail --\x3e\n   <dependency>\n       <groupid>org.springframework.boot</groupid>\n       <artifactid>spring-boot-starter-mail</artifactid>\n   </dependency>\n   \n    \x3c!--  --\x3e\n   <dependency>\n       <groupid>org.springframework.boot</groupid>\n       <artifactid>spring-boot-configuration-processor</artifactid>\n       <optional>true</optional>\n   </dependency>\n   \n\n * \n   \n   #email\n   spring:\n     mail:\n       host: smtp.qq.com #qq  smtp.126.com#126\n       username: 1693849288@qq.com\n       password: pmpartwhndcrfcjg\n   \n   \n   #email \n   mail:\n     mail_from: 1693849288@qq.com\n     mail_to: diana_liangbing@126.com\n     mail_title: "springboot  javamail"\n     mail_msg: "hello javamail!!"\n     ahref: "<a href=\'https://www.baidu.com\'></a>"\n     img: "<img src=\'https://img1.baidu.com/it/u=4065318963,1219732686&fm=253&fmt=auto&app=138&f=jpeg?w=500&h=675\'>"\n   \n\n * \n   \n   * mail.getmail_from()+"(diana)"//\n   \n   @autowired\n   private javamailsender javamailsender;\n   \n   @autowired\n   private mail mail;\n   \n   public  void sendmail(){\n       simplemailmessage message=new simplemailmessage();\n       system.out.println(mail);\n       message.setfrom(mail.getmail_from()+"(diana)");//\n       message.setto(mail.getmail_to());\n       message.setsubject(mail.getmail_title());\n       message.settext(mail.getmail_msg());\n       javamailsender.send(message);\n   }\n   \n\n * \n   \n   * html\n     * 1.settext(mail.getahref(),true);true html false\n     * 2.html\n     * 3.settext()string\n   * \n     * 1.mimemessagehelper helper=new mimemessagehelper(message,true);true `\n     * 2.addattachment()\n   \n   public  void sendmail()  {\n   \n       //\n       file f1=new file("d:\\\\\\\\\\\\\\\\\\\\onedrive\\\\\\\\\\\\java\\\\springboot\\\\\\\\mail\\\\pom.xml");\n       file f2=new file("d:\\\\\\\\\\\\\\\\\\\\onedrive\\\\\\\\\\\\java\\\\springboot\\\\\\\\mail\\\\src\\\\main\\\\resources\\\\.jpg");\n   \n       try {\n           mimemessage message=javamailsender.createmimemessage();\n           mimemessagehelper helper=new mimemessagehelper(message,true); //true \n           helper.setfrom(mail.getmail_from()+"(diana)");//\n           helper.setto(mail.getmail_to());\n           helper.setsubject(mail.getmail_title());\n   \n           // settext \n           helper.settext(mail.getahref());//false,   "<a href=\'https://www.baidu.com\'></a>"\n           helper.settext(mail.getahref(),true);//true html    ----\n           helper.settext(mail.getimg(),true);//settext \n   \n           // addattachment \n           helper.addattachment(f1.getname(),f1);\n           helper.addattachment(f2.getname(),f2);\n   \n           javamailsender.send(message);\n   \n       } catch (exception e) {\n           e.printstacktrace();\n       }\n   \n   }\n   \n\n\n# \n\n\n# \n\n * \n\n * \n\n * \n\n * \n\n * \n   \n   \n\n * \n   \n   * jms()\n     \n     \n   \n   * amqp()\n     \n     \n   \n   * mqtt()\n     \n     > \n\n * \n   \n   * activemq\n   * rabbitmq\n   * rocketmq\n   * kafka\n\n\n# \n\n * arraylist\n\n//\n@service\npublic class messageserviceimpl implements imessageservice {\n\n    private arraylist<string> msglist=new arraylist<string>();\n\n    @override //\n    public void sendmessage(string id) {\n\n        system.out.println("id"+id);\n        msglist.add(id);\n\n    }\n\n    @override//\n    public string domessage() {\n        string id = msglist.remove(0);//id\n        system.out.println("id"+id);\n        return id;\n    }\n}\n\n\n\n# activemq\n\n * \n   \n   * d:\\program files\\mq\\activemq\\apache-activemq-5.16.3\\bin\\win64\\activemq.bat \n   *  http://127.0.0.1:8161/\n\n * \n   \n   \x3c!-- activemq--\x3e\n   <dependency>\n       <groupid>org.springframework.boot</groupid>\n       <artifactid>spring-boot-starter-activemq</artifactid>\n   </dependency>\n   \n\n * yml\n   \n   #activemq\n   spring:\n     activemq:\n       broker-url: tcp://localhost:61616\n     jms:\n       template:\n         default-destination: diana #destination\n       pub-sub-domain: true #false\n   \n\n * \n   \n   * jdbc\n   * \n   \n   @autowired\n   private jmsmessagingtemplate messagingtemplate; //  \n   \n   @override //\n   public void sendmessage(string id) {\n   \n       system.out.println("id"+id);\n       //messagingtemplate.convertandsend(id);  //   default-destination: diana\n       messagingtemplate.convertandsend("order.queue.id",id);// destination\n   }\n   \n   @override// ----------\n   public string domessage() {\n       //        string id = messagingtemplate.receiveandconvert(string.class);//destinationdiana \n       string id = messagingtemplate.receiveandconvert("order.queue.id",string.class);\n       system.out.println("id"+id);\n       return id;\n   }\n   \n   \n   //\n   @component\n   public class messagelistener {\n   \n      @jmslistener(destination = "order.queue.id")//----------\n      @sendto("order.other.queue.id")//\n       public string receive(string id) {\n           system.out.println("id"+id);\n           return "new:"+id;\n       }\n   \n   \n   }\n   \n\n\n# rabbitmq\n\n * \n   \n   d:\\program files\\mq\\rabbitmq\\rabbitmq\\rabbitmq\\rabbitmq_server-3.9.13\\sbincmd\n   \n   * rabbitmq-service.bat strat\n   * rabbitmq-service.bat stop\n   * rabbitmq-service.bat staus\n   * rabbitmq-plugins.bat list\n   * rabbitmq-plugins.bat enable rabbitmq_management\n\n * rabbitmq_management 15672\n   \n   *  guestguest\n   \n   * \n   \n   \n\n * \n   \n   \x3c!-- rabbitmq--\x3e\n   <dependency>\n       <groupid>org.springframework.boot</groupid>\n       <artifactid>spring-boot-starter-amqp</artifactid>\n   </dependency>\n   \n\n * yml\n   \n   # rabbitmq\n   rabbitmq:\n     host: localhost\n     port: 5672  #5672 15672\n   \n\n * \n   \n  